import React, { Card } from "react";

const products = [
  {
    id: 1,
    name: "Master Mask",
    price: "20USD",
    brand: "Maskus",
  },
  {
    id: 2,
    name: "Mask deluxe",
    price: "35USD",
    brand: "My masks",
  },
  {
    id: 3,
    name: "Covid Saver",
    price: "40USD",
    brand: "Maskid",
  },
  {
    id: 4,
    name: "Ferme la bouche",
    price: "15USD",
    brand: "Tancala",
  },
];

const ProductList = ({ products }) => {

  const cardsArray = products.map((product) => (
    <Card
      id={product.id}
      name={product.name}
      price={product.price}
      brand={product.brand}
    />
  ));

  return <div>{cardsArray}</div>;
};

export default ProductList;
